import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import Login from './components/Auth/Login';
import Register from './components/Auth/Register';
import UserManagement from './components/Admin/UserManagement';
import Homepage from './components/Homepage';
import Dashboard from './components/Dashboard';

const App = () => {
  let user = null;
  try {
    user = JSON.parse(localStorage.getItem('user'));
  } catch (e) {
    console.error('Error parsing user data from local storage', e);
  }
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Homepage />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        // <Route path="/admin/users" element={user ? <UserManagement /> : <Navigate to="/login" />} />
        <Route path="/dashboard" element={user ? <Dashboard username={user.username} /> : <Navigate to="/login" />} />
        {/* Add more routes for project management, task management, and file management */}
      </Routes>
    </Router>
  );
};

export default App;
